import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Home.module.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className={`${styles.container} ${styles.contorno}`}>
      <h1 className={`${styles.title} mb-4 text-center ${styles.contorno}`}>Portal do Funcion√°rio</h1>
      <div className={`${styles.box} ${styles.contorno}`}>
        <div className={`d-flex flex-column align-items-center gap-2 w-100 ${styles.contorno}`}>
          <button className={`btn btn-primary w-100 max-w-300 ${styles.contorno}`} onClick={() => navigate('/Login')}>
            Entrar
          </button>
          <button className={`btn btn-secondary w-100 max-w-300 ${styles.contorno}`} onClick={() => navigate('/Cadastrar')}>
            Cadastrar
          </button>
        </div>
      </div>
      <h2 className={`${styles.rodape} mb-4 text-center ${styles.contorno}`}>Desenvolvido por Leonardo Dias</h2>
    </div>
  );
};

export default Home;
